import React from 'react';
import { motion } from 'framer-motion';
import './css/Aboutme.css';

const AboutMe = () => {
  return (
    <div className="about-me-section">
      <motion.div 
        className="about-me-card"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 1 }}
      >
        <div className="about-me-heading">
          <div className="about-me-wrapper">
            <motion.div 
              className="about-me"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ duration: 1.5, delay: 0.5 }}
            >
              ABOUT ME
            </motion.div>
          </div>
          <motion.img 
            className="about-me-heading-child" 
            alt="" 
            src="/line-5.svg" 
            initial={{ scaleX: 0 }}
            animate={{ scaleX: 1 }}
            transition={{ duration: 1 }}
          />
        </div>
        <motion.div 
          className="about-me-details"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 1.5, delay: 1 }}
        >
          <div className="hello-there-im-container">
            <p className="hello-there-im">
            I’m Jayesh Ranjan Kesari, a tech enthusiast with a passion for blending data science, web development, and multimedia into innovative solutions.
            </p>
            <p className="hello-there-im">
            Currently pursuing my degree at Bennett University with a specialization in data science.
            </p>
            <p className="hello-there-im">
            My work reflects a commitment to creating impactful, data-driven applications that are as visually compelling as they are functionally robust.
            </p>
          </div>
        </motion.div>
      </motion.div>
      
      <motion.div 
        className="about-subheading"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1.5, delay: 1.5 }}
      >
        What I do!
      </motion.div>
      
      <motion.div 
        className="card-section"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 2, delay: 2 }}
      >
        <motion.div 
          className="card web-development"
          whileHover={{ scale: 1.05 }}
          transition={{ duration: 0.3 }}
        >
          <div className="card-heading">
            {/* <img className="material-symbolsdownload-icon" alt="" src="/code-icon.svg" /> */}
            <div className="app-development">Data Science & Analytics</div>
          </div>
          <div className="card-content">
            <p>I specialize in transforming data into meaningful insights using machine learning, statistical analysis, and data visualization. Proficient in Python, TensorFlow, and Pandas, I've tackled projects like GDP analysis and text summarization with the T5 model, applying advanced techniques to drive informed decision-making.</p>
            
          </div>
        </motion.div>

        <motion.div 
          className="card app-development-section"
          whileHover={{ scale: 1.05 }}
          transition={{ duration: 0.3 }}
        >
          <div className="card-heading">
            {/* <img className="material-symbolsdownload-icon" alt="" src="/app.svg" /> */}
            <div className="app-development">Web Development</div>
          </div>
          <div className="card-content">
            <p>I create responsive, interactive websites that captivate users. I build web applications that seamlessly blend functionality with aesthetics. My work often merges web development with data science to deliver dynamic, data-driven solutions.</p>
          </div>
        </motion.div>

        <motion.div 
          className="card uiux-section"
          whileHover={{ scale: 1.05 }}
          transition={{ duration: 0.3 }}
        >
          <div className="card-heading">
            {/* <img className="material-symbolsdownload-icon" alt="" src="/ux-icon.svg" /> */}
            <div className="uiux-designing">Visual Storytelling & Multimedia</div>
          </div>
          <div className="card-content">
            <p>My passion for visual storytelling shines through in my photography, video production, and digital art. Using Adobe Creative Suite, I craft compelling visuals that enhance my tech projects and make complex data accessible and engaging.</p>
          </div>
        </motion.div>

      </motion.div>
    </div>
  );
};

export default AboutMe;
